// File: frontend/src/pages/Projects.js
import React from 'react';
import ProjectList from '../components/ProjectList';

const Projects = () => {
  return (
    <div className="projects-page">
      <h1>Projects</h1>
      <ProjectList />
    </div>
  );
};

export default Projects;
